import styled from "styled-components";

const MeuBotao = styled.button`
    background: #FF0000;
    border: 2px solid #0099FF;
    border-radius: 3px;
    color: #FDFDFD;
    font-size: 1.2rem;
    margin: 1rem;
    padding: 1rem 1.5rem;
`;

export default MeuBotao;
